3c3ecddb4efcffbef0fe60922c7cfd6a60f1b690:
query GetAirdropCompleteds($merchantId: Bytes) {
  airdropCompleteds(
    orderBy: blockTimestamp
    first: 5
    orderDirection: desc
    where: {merchant: $merchantId}
  ) {
    merchant
    selectedRecipient
    blockTimestamp
  }
}

21622cf46a429ee984669123adaa99c4c462d8eb:
query GetDailySpendingsMerchant($merchantId: Bytes) {
  totalSpendingStats_collection(
    interval: day
    where: {merchant_: {id: $merchantId}}
    first: 1
  ) {
    id
    merchant {
      id
      name
    }
    timestamp
    totalAmount
  }
}

